function CurrentBuildCard({ el }) {
  console.log(el);
  return (
    <main>
      <div>
        <div className='buildCardItem'>
          {/*begin of image map here */}
          <div className='gallery-item' tabIndex={0}>
            {el.photos.map((el) =>
              el.backgroundimage.map((el) => <img src={el.path} className='buildCardImage' alt='' />)
            )}

            <div className='buildCardItemInfo'>
              <li className='buildCardItemLI'>{el.buildname}</li>
              <ul>
                <li className='buildCardItemLI'>
                  <span className='visually-hidden'>Likes:</span>
                  <i className='fas fa-heart' aria-hidden='true' /> 66
                </li>
                <li className='buildCardItemLI'>
                  <span className='visually-hidden'>Comments:</span>
                  <i className='fas fa-comment' aria-hidden='true' /> 2
                </li>
              </ul>
            </div>
            {/*end of image */}
          </div>
        </div>
        {/* End of gallery */}
      </div>
      {/* End of container */}
    </main>
  );
}

export default CurrentBuildCard;
